import React ,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faGlobeAfrica } from '@fortawesome/free-solid-svg-icons'
class BlockNav extends Component{
	
  render(){
	  
	
    return(
    <div className="container">
   
	 <div className="row">
	 <br/><br/>
	 <div className="row">navigation</div>
	  <div className="row"><FontAwesomeIcon icon={faGlobeAfrica} style={{fontSize:'200%'}}/>dashboard</div> <div className="row"><FontAwesomeIcon icon={faGlobeAfrica} style={{fontSize:'200%'}}/>candidates</div>
	</div>
	 <hr style={{border:'2px groove black',width:'60%'}}/>
	<div className="row">
	 <br/><br/>
	 <div className="row">jobs</div>
	  <div className="row">
	  <FontAwesomeIcon icon={faGlobeAfrica} style={{fontSize:'200%'}}/>live jobs</div> <div className="row"><FontAwesomeIcon icon={faGlobeAfrica} style={{fontSize:'200%'}}/>accepted jobs</div><div className="row"><FontAwesomeIcon icon={faGlobeAfrica} style={{fontSize:'200%'}}/>rejected jobs</div>
	</div>
    </div>
    );
}
}
export default BlockNav;
